import React from "react";
import { Component } from "../../components/Component";
import { Caret } from "../../icons/Caret";
import { Icon1 } from "../../icons/Icon1";
import { Icon2 } from "../../icons/Icon2";
import { Icon20 } from "../../icons/Icon20";
import searchButton from '../../img/icon-4.svg';
import vector3 from '../../img/vector-3.svg';
import town from '../../img/town-2.svg';
import likeButton from '../../img/icon-1.svg';
import apiCred from '../../img/icon-2.svg';
import bigShoes from '../../img/big-shoes-avatar.png';
import fullLogo1 from '../../img/fulllogo-transparent-nobuffer-1.png';
import fullLogo2 from '../../img/fulllogo-transparent-nobuffer-2.png';
import Locations from './Locations';

const Panel = ({ text }) => (
  <div className="relative w-[142px] h-[47px]">
    <div className="relative w-[140px] h-[47px] bg-[#d9d9d940] rounded-[23.5px]">
      <img className="h-1.5 top-[22px] left-28 absolute w-[11px]" alt="Vector" src={vector3} />
      <div className="absolute h-6 top-3 left-5 text-[#2a2a33] text-sm font-light">
        {text}
      </div>
    </div>
  </div>
);

const SidePanelItem = ({ iconSrc, text, notification }) => (
  <div className="h-11 items-center gap-3 px-4 py-3 rounded-[99px] overflow-hidden flex relative">
    <div className="flex items-start gap-3 relative flex-1">
      {iconSrc ? (
        <img className="relative w-5 h-5" alt="Icon" src={iconSrc} />
      ) : (
        <Icon20 className="w-5 h-5" />
      )}
      <div className="relative flex-1 text-ash text-base font-medium">
        {text}
      </div>
      {notification && (
        <div className="absolute w-2 h-2 top-[3px] left-[11px] bg-orange rounded-full border border-white" />
      )}
    </div>
  </div>
);


export const CompareProperty = () => {
  return (
    <div className="bg-white flex flex-row justify-center w-full">
      <div className="bg-white w-[1440px] h-[3568px] relative">
        {/* Search bar */}
        <div className="absolute w-[1012px] h-[47px] top-[103px] left-[397px]">
          <div className="relative w-[236px] h-[47px] bg-[#f6f6fa] rounded-[23.5px] flex items-center">
            <input
              className="w-full h-full pl-6 bg-transparent border-none text-black text-xs font-normal"
              placeholder="Search..."
            />
            <img className="w-[18px] h-[18px] mr-6" alt="Search Icon" src={searchButton} />
          </div>

          <div className="flex w-[768px] h-[47px] items-center gap-[11px] absolute top-0 left-[244px]">
            {['Amenities', 'Square Feet', 'Leasing End Date Range', 'Listing Type'].map((text, idx) => (
              <Panel key={idx} text={text} />
            ))}
          </div>
        </div>

        {/* Title */}
        <div className="absolute top-[29px] left-[397px] text-black text-[32px] font-semibold bg-white">
          Search & Compare
        </div>

        {/* Location listings */}
        <div className="absolute top-[188px] left-[397px] text-base font-semibold text-black">
          Madison Seattle Rental Listings
        </div>

        {/* Locations */}
        <div className="flex flex-col w-[1013px] items-center gap-[31px] absolute top-[216px] left-[397px]">
          <Locations />
        </div>

        {/* Sidebar */}
        <div className="fixed w-[335px] h-[678px] top-[30px] left-[30px] bg-[#f6f6fa] rounded-[37px] overflow-y-auto">
  <div className="w-[220px] h-[61px] top-[41px] left-10 flex items-center">
    <img className="w-10 h-[61px]" alt="Logo" src={fullLogo1} />
    <img className="w-[172px] h-4 ml-3" alt="Logo" src={fullLogo2} />
  </div>
  <img className="w-[280px] h-px bottom-0 left-[27px]" alt="Line" src="/img/line-1.svg" />
  <div className="flex flex-col w-[280px] items-center gap-6 mt-[138px]">
    <div className="flex flex-col items-start gap-1">
      <SidePanelItem iconSrc={town} text="Search & Compare" />
      <SidePanelItem iconSrc={likeButton} text="Favorite" />
    </div>
    <img className="w-full h-px" alt="Line" src="/img/line-1.svg" />
    <div className="flex flex-col items-start gap-1">
      <SidePanelItem text="Notifications" notification />
      <SidePanelItem iconSrc={apiCred} text="API Credentials" />
      <SidePanelItem iconSrc={null} text="Settings" />
      <SidePanelItem iconSrc={null} text="Support" />
    </div>
  </div>
  <div className="w-[200px] absolute bottom-[30px] left-[35px] flex items-center gap-3">
    <div className="relative w-10 h-10 bg-[#ffb21f] rounded-full overflow-hidden">
      <img className="w-10 h-10" alt="User Avatar" src={bigShoes} />
    </div>
    <div className="flex flex-col items-start">
      <div className="text-secondary text-sm">Welcome back ðŸ‘‹</div>
      <div className="text-primary text-base">Johnathan</div>
    </div>
  </div>
  <Caret className="absolute w-5 h-5 top-[613px] left-[247px]" color="#081021" />
        </div>

      </div>
    </div>
  );
};
